import React from "react";
import { useHistory } from "react-router-dom";
import PrizingImg from "../images/prizes.png";
import CRules from "../images/cRules.png";
import Terms from "../images/terms.png";
import "./Pages.css";
// import Header from '../components/header.js'
import { Carousel } from "react-responsive-carousel";
import "react-responsive-carousel/lib/styles/carousel.min.css";

const Prizing = (props) => {
  let history = useHistory();

  return (
    <div className="prizing_container">
      <Carousel
        showThumbs={false}
        swipeable={true}
        showStatus={false}
        emulateTouch={true}
        autoFocus={true}
        showArrows={false}
      >
        <div>
          <img src={PrizingImg} alt="prizing"></img>
        </div>
        <div>
          <img src={CRules} alt="rules"></img>
        </div>
        <div>
          <img src={Terms} alt="terms"></img>

          <div className="nextBtnWrapper">
            <div className="nextBtn">
              <button
                onClick={() => {
                  history.push("/collect");
                }}
              >
                NEXT
              </button>
            </div>
          </div>
        </div>
      </Carousel>
    </div>
  );
};

export default Prizing;

